import HeaderPage from "./HeaderPage"
import modelsback from "./teslaimg/modelS.jfif"
const ModelS = () => {
    return (
      <div className="modelS_container">
      <HeaderPage
         title="ModelS"
         background={modelsback}
         description="Plaid"
         range="390mi"
         time="1.99s"
         speed="200"
      />
             </div>
      );
}
 
export default ModelS;
